import { useState, useCallback } from 'react'; 
import { useNavigate, Link } from "react-router-dom"; 

export default function Home() { 
    return ( 
        <> 
        <div className='main'> 
            <NavBar/> 
        </div> 
        </>); 
} 

function Welcome(){ 
    return (
        <div className='welc'> 
            <div className='side_by_side'> </div>
        </div>
    ); 
}

export function NavBar(){ 
    const navigate = useNavigate(); 

    function handleNavClick(index){ 
        console.log(index); 
        if (index==1){ 
            navigate('/'); 
        } else if (index==2){ 
            navigate('/gallery'); 
        } else if (index==3){ 
            navigate('/login');  
        }
    }
    return(
        <nav className='navbar'> 
            <div className='nav_button_container'> 
                <button onClick={()=>handleNavClick(1)}>Home</button> 
                <button onClick={()=>handleNavClick(2)}>Gallery</button> 
                <button onClick={()=>handleNavClick(3)}>Login</button> 
            </div>
        </nav>
    ); 
}
